//llamada al API

const getDataFromAPI = () => {
  console.log("obteniendo datos del api");
  return fetch("https://randomuser.me/api/?results=50")
    .then((response) => response.json())
    .then((data) => {
      return data;
    });
};

export default getDataFromAPI;
